import React from "react";
import Card from "../Card/Card";
function Overview() {
  return (
    <div>
     <div className="cards">
     <Card num={69} solve={"Unresolved"} />
      <Card num={16} solve={"Overdue"} />
      <Card num={43} solve={"Open"} />
      <Card num={64} solve={"On hold"} />
     </div>
    </div>
  );
}

export default Overview;
